      in_reply_to_status_id: "1165608566184480768",
      created_at: "Sun Aug 25 12:56:36 +0000 2019",
      favorited: false,
      full_text:
        "This brings me to the trend today of hating on platforms. That platforms are taking the power away from creators. Compare them to traditional media platforms, they offer you reach in exchange for control. But you still need to build a direct line of support with your fans.",
      lang: "en",
